import React from 'react';
import whitespace from '../img/symbols/WHITESPACE.png';
import './PlaneDisplay.css';

export default function PlaneDisplay({activePlane, handleClick}) {
    console.log('display');
    const planeUrl = activePlane ? activePlane.url : null;
    return (
        <div className="plane">
            <img key={Date.now()}
                src={planeUrl}
                className="plane-img"
                alt={whitespace}
                onClick={handleClick}
            />
            <h1>{activePlane.url}</h1>
        </div>
    ); 
}
